import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { addgoldenHandler } from "../../service/auth.service";
import { validName } from "../../utils/helper";
import toast from "react-hot-toast";
import Navbar from "../Navbar";

export default function Addgolden() {
  const navigate = useNavigate();
  const [goldenName, setGoldenName] = useState("");
  const [goldenNameErr, setGoldenNameErr] = useState(false);
  const [goldenImg, setGoldenImg] = useState("");
  const [file, setFile] = useState();
  const [goldenImgErr, setGoldenImgErr] = useState(false);
  const [selected, setSelected] = useState(false);
  const successnotify = (msg) =>
    toast.success(msg, { duration: 4000, id: msg });
  const errornotify = (msg) => toast.error(msg, { duration: 4000, id: msg });
  const validation = () => {
    let formIsValid = true;
    if (!goldenName) {
      formIsValid = false;
      setGoldenNameErr("Your Golden name is required");
    }
    if (!goldenImg) {
      formIsValid = false;
      setGoldenImgErr("Your Golden image is required");
    }
    if (!validName.test(goldenName)) {
      formIsValid = false;
      setGoldenNameErr("Your Golden name is invalid");
    }

    return formIsValid;
  };
  const handleSubmit = (e) => {
    if (validation() !== true) {
    } else {
      postData(e);
      setSelected(true);
    }
    e.preventDefault();
  };
  const postData = async (event) => {
    event.preventDefault();
    let reqBody;
    reqBody = new FormData();
    reqBody.append("goldenName", goldenName);
    reqBody.append("goldenImg", goldenImg);
    const response = await addgoldenHandler(reqBody);
    if (response.success) {
      setSelected(false);
      navigate("/golden");
      successnotify(response.message);
      setSelected(false);
    } else {
      errornotify(response.message);
      setSelected(false);
    }
  };
  function handleChange(e) {
    setFile(URL.createObjectURL(e.target.files[0]));
    setGoldenImg(e.target.files[0]);
  }
  return (
    <div>
      <div className="layout-wrapper layout-content-navbar  ">
        <div className="layout-container">
          {/* Menu */}
          <aside
            id="layout-menu"
            className="layout-menu menu-vertical menu bg-menu-theme"
          >
            <div className="app-brand demo ">
              <Link to="/" className="app-brand-link">
                <span className="app-brand-logo demo">
                  <img
                    src="data:image/png;base64,"
                    alt="logo"
                    width="200"
                    className="src"
                  />
                </span>
                <span className="app-brand-text demo menu-text fw-bolder ms-2"></span>
              </Link>
              <a className="layout-menu-toggle menu-link text-large ms-auto d-block d-xl-none">
                <i className="bx bx-chevron-left bx-sm align-middle" />
              </a>
            </div>
            <div className="menu-inner-shadow" />
            <ul className="menu-inner py-1">
              {/* Dashboard */}
              <li className="menu-item">
                <Link to="/" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-home-circle" />
                  <div data-i18n="Analytics">Dashboard</div>
                </Link>
              </li>
              <li className="menu-item active">
                <Link to="/golden" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-category" />
                  <div data-i18n="Analytics">Golden Collection</div>
                </Link>
              </li>
              <li className="menu-item ">
                <Link to="/sliver" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-category" />
                  <div data-i18n="Analytics">Sliver Collection</div>
                </Link>
              </li>

              <li className="menu-item ">
                <Link to="/goldenproducts" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-category-alt" />
                  <div data-i18n="Analytics">Golden Products</div>
                </Link>
              </li>
              <li className="menu-item ">
                <Link to="/sliverproducts" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-category-alt" />
                  <div data-i18n="Analytics">Sliver Products</div>
                </Link>
              </li>
              <li className="menu-item ">
                <Link to="/banner" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-windows" />
                  <div data-i18n="Analytics">Web Banner</div>
                </Link>
              </li>
              <li className="menu-item ">
                <Link to="/career" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-medal" />
                  <div data-i18n="Analytics">Career </div>
                </Link>
              </li>
              <li className="menu-item ">
                <Link to="/contact" className="menu-link">
                  <i className="menu-icon tf-icons bx bx-conversation" />
                  <div data-i18n="Analytics">Contact</div>
                </Link>
              </li>
            </ul>
          </aside>
          {/* / Menu */}
          {/* Layout container */}
          <div className="layout-page">
            {/* Navbar */}
            <Navbar />
            {/* / Navbar */}
            {/* Content wrapper */}
            <div className="content-wrapper">
              {/* Content */}

              <div className="container-xxl flex-grow-1 container-p-y ">
                <div
                  style={{
                    display: "flex",
                    justifyContent: "space-between",
                    marginTop: "1rem",
                    marginBottom: "1rem",
                  }}
                >
                  <span
                    classname="topName"
                    style={{ fontSize: "x-large", fontWeight: "600" }}
                  >
                    Add Golden
                  </span>
                </div>
                <div className="row">
                  <div className="col-xl">
                    <div className="card mb-4">
                      <div className="card-header d-flex justify-content-between align-items-center">
                        <h5 className="mb-0">Add New Golden</h5>
                        <small className="text-muted float-end">
                          Add Golden Infomation
                        </small>
                      </div>
                      <div className="card-body">
                        <form
                          onSubmit={(e) => {
                            handleSubmit(e);
                          }}
                          method="post"
                        >
                          <div className="mb-3">
                            <label
                              className="form-label"
                              htmlFor="basic-default-fullname"
                            >
                              Golden Name
                            </label>
                            <input
                              type="text"
                              id="goldenName"
                              name="goldenName"
                              className="form-control"
                              placeholder="Enter Golden Name"
                              onChange={(e) => [
                                setGoldenName(e.target.value),
                                setGoldenNameErr(" "),
                              ]}
                            />
                          </div>
                          {goldenNameErr && (
                            <p className="errorstyle">{goldenNameErr}</p>
                          )}

                          <div className="mb-3">
                            <label
                              className="form-label"
                              htmlFor="basic-default-company"
                            >
                              Golden Image
                            </label>
                            <input
                              type="file"
                              id="goldenImg"
                              name="goldenImg"
                              className="form-control"
                              placeholder="Add Golden Iamge"
                              onChange={(e) => [
                                handleChange(e),
                                setGoldenImgErr(" "),
                              ]}
                            />
                          </div>
                          {goldenImgErr && (
                            <p className="errorstyle">{goldenImgErr}</p>
                          )}

                          <div className="mb-3">
                            <label
                              className="form-label"
                              htmlFor="basic-default-company"
                            >
                              Golden Image
                            </label>
                            <br />
                            <img
                              src={file}
                              alt=""
                              style={{ width: "15%", borderRadius: "6px" }}
                            />
                          </div>

                          <button type="submit" className="btn btn-primary">
                            {selected ? "Loading..." : "Add Golden "}
                          </button>
                          <button
                            type="submit"
                            className="btn btn-primary"
                            style={{
                              marginLeft: "12px",
                            }}
                            onClick={() => navigate("/golden")}
                          >
                            Back
                          </button>
                        </form>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
              {/* / Content */}

              {/* Footer */}
              <footer className="content-footer footer bg-footer-theme">
                <div className="container-xxl d-flex flex-wrap justify-content-between py-2 flex-md-row flex-column">
                  <div className="mb-12 mb-md">
                    Made by Acquire Web Solution Pvt. Ltd.
                  </div>
                </div>
              </footer>
              {/* / Footer */}
              <div className="content-backdrop fade" />
            </div>
            {/* Content wrapper */}
          </div>
          {/* / Layout page */}
        </div>
        {/* Overlay */}
        <div className="layout-overlay layout-menu-toggle" />
      </div>
    </div>
  );
}
